import React, { Component, useState } from "react";
import "./App.css";
import Navbar from "./component/navbar";
import Card from "./component/usercard";


class App extends Component {

  state = {}
  onGet = (data) => {
    this.setState({data})
  };

  render() {

    return (
      <div className="App">
        <Navbar onGet={this.onGet} />
        <Card Data={this.state}/>
      </div>
    );
  }
}

export default App;
